<div id="onetrust-consent-sdk"><div class="onetrust-pc-dark-filter ot-hide ot-fade-in"></div><div id="onetrust-pc-sdk" class="otPcCenter ot-hide ot-fade-in" lang="en" aria-label="Preference center" role="region"><div role="alertdialog" aria-modal="true" aria-describedby="ot-pc-desc" style="height:100%" aria-label="Privacy Preference Center"><div class="ot-pc-header"><div class="ot-pc-logo" role="img" aria-label="Company Logo"><img alt="Company Logo" src="data:image/png;base64,"></div><button id="close-pc-btn-handler" class="ot-close-icon" aria-label="Close" style="background-image:url(data:image/svg+xml;base64,)"></button></div><div id="ot-pc-content" class="ot-pc-scrollbar"><div class="ot-optout-signal ot-hide"><div class="ot-optout-icon"><svg xmlns="http://www.w3.org/2000/svg"><path class="ot-floating-button__svg-fill" d="M14.588 0l.445.328c1.807 1.303 3.961 2.533 6.461 3.688 2.015.93 4.576 1.746 7.682 2.446 0 14.178-4.73 24.133-14.19 29.864l-.398.236C4.863 30.87 0 20.837 0 6.462c3.107-.7 5.668-1.516 7.682-2.446 2.709-1.251 5.01-2.59 6.906-4.016zm5.87 13.88a.75.75 0 00-.974.159l-5.475 6.625-3.005-2.997-.077-.067a.75.75 0 00-.983 1.13l4.172 4.16 6.525-7.895.06-.083a.75.75 0 00-.16-.973z" fill="#FFF" fill-rule="evenodd"></path></svg></div><span></span></div><h2 id="ot-pc-title">Privacy Preference Center</h2><div id="ot-pc-desc">When you visit any website, it may store or retrieve information on your browser, mostly in the form of cookies. This information might be about you, your preferences or your device and is mostly used to make the site work as you expect it to. The information does not usually directly identify you, but it can give you a more personalized web experience. Because we respect your right to privacy, you can choose not to allow some types of cookies. Click on the different category headings to find out more and change our default settings. However, blocking some types of cookies may impact your experience of the site and the services we are able to offer.
            <br><a href="#" class="privacy-notice-link" rel="noopener" target="_blank" aria-label="More information about your privacy, opens in a new tab">More information</a></div><button id="accept-recommended-btn-handler">Allow All</button><section class="ot-sdk-row ot-cat-grp"><h3 id="ot-category-title"> Manage Consent Preferences</h3><div class="ot-accordion-layout ot-cat-item ot-vs-config" data-optanongroupid="C0001"><button aria-expanded="false" ot-accordion="true" aria-controls="ot-desc-id-C0001" ></button><div class="ot-acc-hdr ot-always-active-group"><div class="ot-plus-minus"><span></span><span></span></div><h4 class="ot-cat-header" id="ot-header-id-C0001">Strictly necessary cookies -  essential in order for the Site to function properly </h4><div class="ot-always-active">Always Active</div></div><div class="ot-acc-grpcntr ot-acc-txt"><p class="ot-acc-grpdesc ot-category-desc" id="ot-desc-id-C0001"> They may include, for example, cookies which collect session ID and authentication data, cookies which make it possible to personalize the interface of a Site  (for example, for the choice of language or the presentation of a service) or even certain analytics cookies. This category of cookies also includes cookies that help us comply with our legal obligations, including ensuring a safe online environment (for example by detecting repetitive login failures to prevent unauthorized persons from accessing your account). </p></div></div><div class="ot-accordion-layout ot-cat-item ot-vs-config" data-optanongroupid="C0002"><button aria-expanded="false" ot-accordion="true" aria-controls="ot-desc-id-C0002" ></button><div class="ot-acc-hdr"><div class="ot-plus-minus"><span></span><span></span></div><h4 class="ot-cat-header" id="ot-header-id-C0002">Analytics cookies -  understand how you access on our site and to measure the number of visitors to our Site</h4><div class="ot-tgl"><input type="checkbox" name="ot-group-id-C0002" id="ot-group-id-C0002" aria-checked="true" role="switch" class="category-switch-handler" data-optanongroupid="C0002" checked > <label class="ot-switch" for="ot-group-id-C0002"><span class="ot-switch-nob" aria-checked="false" role="switch"></span> <span class="ot-label-txt">Analytics cookies -  understand how you access on our site and to measure the number of visitors to our Site</span></label> </div></div><div class="ot-acc-grpcntr ot-acc-txt"><p class="ot-acc-grpdesc ot-category-desc" id="ot-desc-id-C0002">These cookies allow us as well as our partners, to understand how you access on our Site and to measure the number of visitors to our Site. <br> They are also used to analyze the way you browse the Site or to reconstruct your journey. This helps us improve the way our Sites work by ensuring, for example, that users easily find what they are looking for. By refusing these cookies, we will not be able to analyze how you use the Site. </p></div></div><div class="ot-accordion-layout ot-cat-item ot-vs-config" data-optanongroupid="C0003"><button aria-expanded="false" ot-accordion="true" aria-controls="ot-desc-id-C0003" ></button><div class="ot-acc-hdr"><div class="ot-plus-minus"><span></span><span></span></div><h4 class="ot-cat-header" id="ot-header-id-C0003">Preference cookies - These cookies allow us to personalize and offer the content and functionality of the Sites</h4><div class="ot-tgl"><input type="checkbox" name="ot-group-id-C0003" id="ot-group-id-C0003" aria-checked="true" role="switch" class="category-switch-handler" data-optanongroupid="C0003" checked > <label class="ot-switch" for="ot-group-id-C0003"><span class="ot-switch-nob" aria-checked="false" role="switch"></span> <span class="ot-label-txt">Preference cookies - These cookies allow us to personalize and offer the content and functionality of the Sites</span></label> </div></div><div class="ot-acc-grpcntr ot-acc-txt"><p class="ot-acc-grpdesc ot-category-desc" id="ot-desc-id-C0003">They are used, for example, to remember the preferences indicated during your visit to our Site and to improve our Site and your user experience. By refusing these cookies, we will not be able to optimize your user experience on our Siteand some parts may not function properly. </p></div></div><div class="ot-accordion-layout ot-cat-item ot-vs-config" data-optanongroupid="C0004"><button aria-expanded="false" ot-accordion="true" aria-controls="ot-desc-id-C0004" ></button><div class="ot-acc-hdr"><div class="ot-plus-minus"><span></span><span></span></div><h4 class="ot-cat-header" id="ot-header-id-C0004">Advertising Cookies - Allow us and our partners to provide you with personalized or no personalized and geolocated advertising, more relevant to your interests </h4><div class="ot-tgl"><input type="checkbox" name="ot-group-id-C0004" id="ot-group-id-C0004" aria-checked="true" role="switch" class="category-switch-handler" data-optanongroupid="C0004" checked > <label class="ot-switch" for="ot-group-id-C0004"><span class="ot-switch-nob" aria-checked="false" role="switch"></span> <span class="ot-label-txt">Advertising Cookies - Allow us and our partners to provide you with personalized or no personalized and geolocated advertising, more relevant to your interests </span></label> </div></div><div class="ot-acc-grpcntr ot-acc-txt"><p class="ot-acc-grpdesc ot-category-desc" id="ot-desc-id-C0004">Category: Personalized advertising cookies <br> These cookies allow us and our partners, to provide you with personalized advertising, more relevant to your interests. <br> They record your visit to our Site , the pages you have viewed and the links you have followed. We use as well as our partners, this information in order to make our Site as well as the advertisements which appear there, if any, as relevant as possible with regard to your centers of interest. They can also be used to display personalized advertisements about our products on other sites, to measure the effectiveness of an advertising campaign, to limit the frequency of distribution (i.e. limiting the number of times you see an advertisement), advertising affiliation, detection of click fraud, market research, product improvement, debugging. By refusing these cookies, we will not be able to personalize the advertisements you will see. <br>   Category: Non-personalized advertising cookies <br>  These cookies allow us as well as our partners to display advertisements that are not personalized to your profile.  These cookies can be used exclusively to measure the performance of a marketing campaign, which we will not be able to do if you refuse them. <br>   Category: Geolocated advertising cookies <br> These cookies allow us as well as our partners, to show you personalized advertising based on your location (geolocated advertising). <br> By refusing these cookies, we will not be able to offer you personalized advertising based on your geolocation. <br> </p></div></div><div class="ot-accordion-layout ot-cat-item ot-vs-config" data-optanongroupid="C0005"><button aria-expanded="false" ot-accordion="true" aria-controls="ot-desc-id-C0005" ></button><div class="ot-acc-hdr"><div class="ot-plus-minus"><span></span><span></span></div><h4 class="ot-cat-header" id="ot-header-id-C0005">Social media and content sharing cookies - share information with the social networks and propose the visualization on our website of the content hosted on a external website.</h4><div class="ot-tgl"><input type="checkbox" name="ot-group-id-C0005" id="ot-group-id-C0005" aria-checked="true" role="switch" class="category-switch-handler" data-optanongroupid="C0005" checked > <label class="ot-switch" for="ot-group-id-C0005"><span class="ot-switch-nob" aria-checked="false" role="switch"></span> <span class="ot-label-txt">Social media and content sharing cookies - share information with the social networks and propose the visualization on our website of the content hosted on a external website.</span></label> </div></div><div class="ot-acc-grpcntr ot-acc-txt"><p class="ot-acc-grpdesc ot-category-desc" id="ot-desc-id-C0005">Category: Social media cookies<br> The display of this type of content on our Sites shares information about your browsing on our Sites  with the social networks used. By refusing these cookies, we will not be able to allow you to share content from our Site  to social networks.<br>  Category: Content sharing cookies<br> Viewing this type of content on our Sites involves sharing with the hosting site information about your browsing on our Sites. By refusing these cookies, we will not be able to allow you to view certain content integrated on our site, when they are hosted on an external hosting platform. </p></div></div></section></div><section id="ot-pc-lst" class="ot-hide ot-hosts-ui ot-pc-scrollbar"><div id="ot-pc-hdr"><div id="ot-lst-title"><button class="ot-link-btn back-btn-handler" aria-label="Back"><svg id="ot-back-arw" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" x="0px" y="0px" viewBox="0 0 444.531 444.531" xml:space="preserve"><title>Back Button</title><g><path fill="#656565" d="M213.13,222.409L351.88,83.653c7.05-7.043,10.567-15.657,10.567-25.841c0-10.183-3.518-18.793-10.567-25.835
